      "\n                    \n                        \ubc30\uc1a1\uc740 \uc77c\ub2e8 \ud070 \ubc15\uc2a4\uc5d0 \uc798 \uc654\uc5b4\uc694. \n\ubc15\uc2a4\ud6fc\uc190, \uc0c1\ud488\ud30c\uc190 \uc774\ub7f0 \uc704\ud5d8\uc740 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4. \n\ube44\uc2fc\ud150\ud2b8 \uc0ac\ub46c\ubd10\uc57c \ube44\ubc14\ub78c \ubaa8\ub798 \ub9de\uc73c\uba74 \ud6fc\uc190\ub418\ub294\uac70 \ub611\uac19\ub2e4\ub294 \uac00\uc871\ub4e4\uc758 \ub9d0\uc5d0 \uace0\ubbfc \ub05d\uc5d0 \ud55c\ucca0 \uc4f0\uace0 \ubd80\ub2f4\uc5c6\uc774 \ubcf4\uad00\ud560 \uc218 \uc788\ub294 \uc800\ub834\ud55c \uc774 \ud150\ud2b8\ub85c \uad6c\ub9e4\ud588\uc5b4\uc694. \n\n\uacb0\ub860\uc740 \ud55c\ucca0\uc4f0\uae30 \uaf64 \uad1c\ucc2e\ub2e4\ub294 \uac81\ub2c8\ub2e4. \n\n1. \ud3ec\uc7a5\n\ud070 \ubc15\uc2a4 \uc5f4\uba74 \uac19\uc740 \ud480\uc0c9 \uacc4\uc5f4\uc758 \ub098\uc77c\ub860 \uac00\ubc29\uc5d0 \ud150\ud2b8 \ub4e4\uc5b4\uc788\uc2b5\ub2c8\ub2e4.  \ud150\ud2b8\ub294 \ud558\uc580 \uace0\ubb34\uc904\ub85c \uace0\uc815\ub418\uc788\uace0, \uc774 \uace0\ubb34\uc904\uc740 \ud56d\uc0c1 \ubcf4\uad00\ud574\uc57c \ud569\ub2c8\ub2e4. \ub098\uc911\uc5d0 \ud150\ud2b8 \uc811\uace0\ub098\uc11c \uc774 \uace0\ubb34\uc904\ub85c \uace0\uc815 \ub610 \ud574\uc57c\ub418\uc694\n\n2. \ubb34\uac8c\n\ub9e4\uc6b0 \uacbd\ub7c9\ubb34\uac8c \uc785\ub2c8\ub2e4. \uc5ec\uc790\ub3c4 \ud55c\uc190\uc73c\ub85c \ucda9\ubd84\ud788 \ub4e4\uace0 \uc5b4\ub9b0\uc774\ub3c4 \ucda9\ubd84\ud788 \ub4e4\uc5b4\uc694. \ubb50 \ud55c 1-2kg \ub418\ub824\ub098? \uc544\uc8fc \uac00\ubcbc\uc6cc\uc694. \ubd80\ud53c\uac00 \ud06c\uc9c0\ub9cc \ub0a9\uc791\ud558\uace0 \uc544\uc8fc \uac00\ubccd\uc2b5\ub2c8\ub2e4\n\n3. \ud150\ud2b8 \uc624\ud508\n\ubcf4\ub2c8\uae4c \ub2e4\ub4e4 \ud150\ud2b8 \uc624\ud508\uc740 \ud3bc\uce58\uae30\ub9cc \ud558\uba74 1\ucd08 \uc548\uc5d0 \ub41c\ub2e4 \uc544\uc8fc\uc27d\ub2e4 \uadf8\ub7ec\uc2dc\ub354\ub77c\uad6c\uc694. \uadfc\ub370 \ub625\uc190\uc774\uc600\ub358 \uc6b0\ub9ac \uac00\uc871\uc740 \u314b\u314b \uc624\ud508\ub3c4 \uc0b4\uc9dd \ud5e4\ub9f8\uc2b5\ub2c8\ub2e4 \u3160\n\ubc14\ub85c \uc624\ud508\ud558\uba74 \uc548\ub418\uace0 \ud3f4\ub300\ub07c\ub9ac \uc5f0\uacb0\ub418\uc788\ub294\uac78 \ubd84\ub9ac \ud6c4 \ud3bc\uce58\uba74 \ubc14\ub85c \uc15c\uce58\ub418\uc694. \uadf8\uac78 \ubaa8\ub974\uace0 \uacc4\uc18d \ud3bc\uce58\ub824\uace0 \ud588\ub294\ub370 \uc548\ub418\uc11c.. \ub3d9\uc601\uc0c1 \ucc3e\uc544\ubd10\ub3c4 \uc624\ud508\uc740 \uc5c6\ub354\ub77c\uace0\uc694. \n\n\uc124\uba85\uc11c\uac00 \ud55c\uc7a5 \uc9dc\ub9ac\ub77c\ub3c4 \uc788\uc74c \uc88b\uc740\ub370 \uc124\uba85\uc11c \uc544\uc608 \uc5c6\uc5b4\uc694. \n\uc6d0\ud130\uce58\ub77c\uc11c \uadf8\ub7f0\uc9c0 \ubaa8\ub450\uac00 \uc544\uc8fc \uc27d\uac8c \uc5f4\uace0 \ub2eb\uc744\uaebc\ub77c \uc0dd\uac01\ud558\uc168\ub098\ubd10\uc694. \ud558\uc9c0\ub9cc \uc138\uc0c1\uc5d0\ub294 \ub9ce\uc740 \uad70\uc0c1\uc774 \uc874\uc7ac\ud558\uace0 \uadf8 \uad70\uc0c1\ub4e4 \uc911\uc5d0 \uc6b0\ub9ac\uac19\uc740 \ub625\uc190\ub4e4\ub3c4 \uc788\ub2e4\ub294 \uc810\uc744 \uae30\uc5b5\ud574\uc8fc\uc138\uc694 \uc5c9\uc5c9 \u3160 \n\n4. \ud150\ud2b8 \uc811\uae30\n\uc6d0\ud130\uce58\uc758 \ucd5c\ub300\ub2e8\uc810\uc740 \uac00\ubccd\uace0 \uc2fc \ub300\uc2e0 \ud3f4\ub300\uac00 \ud50c\ub77c\uc2a4\ud2f1\uc774\ub2e4\ubcf4\ub2c8 \ud798\uc744 \uc880\ub9cc \uc918\ub3c4 \ubd80\ub7ec\uc9c8 \uac83 \uac19\uc740 \uadf8 \ub450\ub824\uc6c0\uc5d0 \uc811\uae30\uac00 \uc5b4\ub835\ub2e4\ub294 \uac70\uc5d0\uc694 \u3160 \n\ud798\uc744 \uc880 \uc8fc\uba74 \ubd80\ub7ec\uc9c8 \uac83 \uac19\uc740 \ub290\ub08c\uc801 \ub290\ub08c \ub55c\uc5d0 \uc800\ud76c \uac00\uc871\uc740 \ub610 \ud55c\ucc38 \ud5e4\ub9f8\uc2b5\ub2c8\ub2e4. \ucfe0\ud321\uc5d0\ub3c4 \uad6c\ub9e4 \ud398\uc774\uc9c0 \uc0c1\uc138\uc124\uba85\uc5d0 \uc811\ub294 \ubc95\uc774 \ub098\uc640\uc788\uc9c0\ub9cc.. \uadf8\uac83\ubcf4\ub2e4\ub294 \uadf8\ub0e5 \uc720\ud29c\ube0c\uc5d0 \uc6d0\ud130\uce58 \ud150\ud2b8 \uc811\ub294 \ubc95 \uac80\uc0c9\ud574\uc11c \ubcf4\uba74 5\ubd84 10\ubd84\uc9dc\ub9ac \uc601\uc0c1 \ub118\uccd0\uc694. \uadf8\uac70\ubcf4\uc138\uc694. \uadf8\uac8c \ub354 \ub3c4\uc6c0 \ub429\ub2c8\ub2e4. \n\n\ucc38\uace0\ub85c \ud150\ud2b8 \uc811\uace0 \ub098\uc911\uc5d0 8\uc790 \ubaa8\uc591\uc73c\ub85c \uc811\uc5b4\uc57c \ud558\ub294\ub370 \uadf8\ub54c \ubd80\ub7ec\uc9c8 \uac83 \uac19\uc740 \ub450\ub824\uc6c0\uc744 \uc5b5\ub204\ub974\uace0 \uadf8\ub0e5 \ud798\uc918\uc11c \uc811\uc5b4\ubc84\ub9ac\uc138\uc694. \uadf8\ub798\uc57c \uc811\ud788\uace0 \uc0dd\uac01\ubcf4\ub2e4 \uc548 \ubd80\ub7ec\uc9c0\ub354\ub77c\uace0\uc694. \n\n5. \ud734\uac00\uc9c0 \uc2e4\uc0ac\uc6a9 \ud6c4\uae30\n\uc800\ud76c\ub294 \ubbfc\ud3d0\ucda9\ub098\ub77c \uc911\uad6d \ub55c\uc5d0 \uc774\ub188\uc758 \uc6b0\ud55c\ud3d0\ub834 \uc2dc\uad6d\uc774 \uc548 \ub05d\ub098\uc11c \uc624\ub7ab\ub3d9\uc548 \uc9d1\uc5d0 \uac07\ud600\uc788\uc5c8\uc5b4\uc694. \uc140\ud504\ubc29\uc5ed \uc815\ub9d0 \ucca0\uc800\ud788 \uc9c0\ud0a4\ub294 \uc2a4\ud0c0\uc77c\ub4e4\uc774\uac70\ub4e0\uc694. \n\uadf8\ub7ec\ub2e4 \uc9c4\uc9dc \ubbf8\uccd0\ubc84\ub9b4 \uac83 \uac19\uc544\uc11c \ucc28\ud0c0\uace0 \uc0ac\ub78c \uc544\ubb34\ub3c4 \uc5c6\ub294 \uacf3\uc73c\ub85c \ub2f9\uc77c\uce58\uae30 \ub5a0\ub0ac\uc5b4\uc694. \uc815\ub9d0 \ub9d0 \uadf8\ub300\ub85c \uc544\ubb34\ub3c4 \uc5c6\ub294 \uc5b4\ub290 \uc774\ub984\ubaa8\ub97c \ud574\ubcc0\uac00\uc5d0 \uac00\uc11c \ud150\ud2b8 \ud3bc\ucce4\ub294\ub370 \uc88b\uc558\uc5b4\uc694. \n\n\ud150\ud2b8\uac00 \uc6cc\ub099 \uac00\ubcbc\uc6cc\uc11c \ubc14\ub78c\uc5d0 \ub0a0\ub77c\uac08\uae4c\ubd10 \uac71\uc815\ud558\uae34 \ud588\ub294\ub370 \ubb50 \ud604\uc2e4\uc801\uc73c\ub85c \uc5b4\ub514\uac00\uba74 \ub098\ub984 \ubc30\ub0ad \uc9d0 \uc544\uc774\uc2a4\ubc15\uc2a4 \ub2e4 \ucc59\uae30\uc796\uc544\uc694. \uadf8\ub7f0\uac70 \ub123\uc5b4\ub450\uba74 \uc6ec\ub9cc\ud574\uc120 \uc548 \ub0a0\ub77c\uac11\ub2c8\ub2e4. \n\ubb3c\ub860 \uac15\ud48d\uc5d0\ub294 \ubaa8\ub974\uaca0\uc9c0\ub9cc. \uadf8\ub0e5 \ub0a0\uc528 \uc88b\uc744 \ub54c \ud55c\ucca0 \uc4f0\uaca0\ub2e4 \ud558\uc2dc\ub294 \ubd84\ub4e4. \uac71\uc815\ub9d0\uace0 \uc800\ub834\ud788 \uad6c\ub9e4\ud558\uc138\uc694. \uc548\ub0a0\ub77c\uac11\ub2c8\ub2e4.\n\n\ud587\ubcd5\uc740 \uc5bc\ub9c8\ub098 \uac00\ub9ac\ub294\uac00... \n\uc798 \uac00\ub824\uc9d1\ub2c8\ub2e4. \ucc3d\ubb38\ub3c4 2\uac1c \uc788\uace0, \ubaa8\uae30\uc7a5 \uac19\uc740 \uc587\uc740 \ubb38\uc774 \ucd9c\uc785\uad6c \uc591\ucabd\uc5d0 \uc124\uce58\ub418 \uc788\uc5b4\uc11c \ucd9c\uc785\uad6c \ucc3d\ubb38 \ub2e4 \uac1c\ubc29\ud574\ub450\uba74 \ubc14\ub78c \uc798 \ud1b5\ud574\uc694. \ub2e4\ub9cc \uc544\uc8fc \uc587\uc740 \ucc9c\uc774\ub2c8\uae4c \ubc14\ub2e6\uc5d0 \ubb50 \uae54\uac70 \uac00\uc838\uac00\uc138\uc694. \n\n6. \ud06c\uae30\n2-3\uc778\uc6a9 \ud150\ud2b8\uac00 \ub108\ubb34 \uc791\ub2e4\ub294 \ud3c9\uc774 \ub9ce\uc544\uc11c \uc800\ud76c\ub294 \ud604\uc7ac 2\uc778 \uac00\uc871\uc784\uc5d0\ub3c4 3-4\uc778\uc6a9\uc73c\ub85c \uc0c0\uc5b4\uc694. \n\uc800 \ub0a8\ud3b8 \ub458\uc774 \ub4e4\uc5b4\uac00\uc11c \ub204\uc6cc\ubd24\ub294\ub370 3-4\uc778\uc6a9 \ucda9\ubd84\ud788 \uc0ac\uc6a9 \uac00\ub2a5\ud558\uace0 \uc544\uc774\ub4e4 2 \ud0dc\uc5b4\ub098\uba74 4\uc778\uac00\uc871 \ucda9\ubd84\ud788 \uc4f8 \ub9cc \ud569\ub2c8\ub2e4. \n\ub2e4\ub9cc \ubab8\uc9d1 \ud06c\uc2e0 \uc131\uc778\ubd84\ub4e4\uc740 3-4\uc778\uc6a9\uc774\uba74 4\uc778 \ub9d0\uace0 3\uc778 \uc0ac\uc6a9\ud06c\uae30\ub77c\uace0 \uc0dd\uac01\ud558\uc138\uc694. 2\uc778 \uc4f0\uc2dc\uae30\uc5d4 3-4\uc778\uc6a9 \ub113\uc5b4\uc694 \n\n\uacb0\ub860\n\ud55c\ucca0 \uc4f0\uace0 \uc798 \ubcf4\uad00\ud558\uba74 \uba87 \ucca0 \ub354 \uc4f8 \uc218 \uc788\uc5b4\uc694. \n\uc800\ud76c\ub294 \ube44 \ubc14\ub78c \uc548 \ub9de\uc558\uace0 \uc5ec\ub984 \ub561\ubcd5\uc5d0\uc11c \ud558\ub8e8 \uc0ac\uc6a9 \ud588\ub294\ub370 \ud070 \uc190\uc0c1 \uc5c6\uc5c8\uae30 \ub55c\uc5d0 \uc798 \ubcf4\uad00\ud574\ub480\uc5b4\uc694. \ub2e4\uc74c \ud574\uc5d0\ub3c4 \ucda9\ubd84\ud788 \ub610 \uc4f8 \uc218 \uc788\uc744 \uac83 \uac19\uc544\uc694.\n                    \n                ",
