      "\n                    \n                        \ucea0\ud551\uacc4\uc758 \uc774\ucf00\uc544\ub77c \ubd88\ub9ac\ub294 \ub370\uce74\ud2b8\ub860 \ube0c\ub79c\ub4dc\uac00 \uc694\uc998 \ud56b\ud569\ub2c8\ub2e4! \n\ub370\uce74\ud2b8\ub860\uc5d0\uc11c \ub2e4\uc591\ud55c \ud150\ud2b8\ub4e4\uc774 \uc788\ub294\ub370\uc694, \uc774 \ud150\ud2b8\ub294 \uc800\ub834\ud558\uc9c0\ub9cc \uc6d0\ub2e8\ub3c4 \uc9f1\uc9f1\ud558\uace0 \ud544\uc694\ud55c \uae30\ub2a5\ub4e4\ub9cc \uac16\ucd98 \uc785\ubb38\uc6a9 \uadf9\uac00\uc131\ube44 \uc88b\uc740 \ud150\ud2b8\uc778\uac83 \uac19\uc544\uc694! \ubbf8\ub2c8\uba40 \ucea0\ud551, \ubc31\ud328\ud0b9\uc6a9, \ucd08\ub300\uc6a9, \uc11c\ube0c\uc6a9\uc73c\ub85c \uc88b\uc740 \ud150\ud2b8\uc785\ub2c8\ub2e4!\n\n\uc5b8\ubc15\uc2f1\ud558\uba70 \uc0b4\ud3b4\ubcf8 \ud150\ud2b8 \uad6c\uc131\ud488\uacfc \uc2e4\uc678 \uc124\uce58\ubaa8\uc2b5\uc744 \uc601\uc0c1\uc73c\ub85c \ub2f4\uc544\ubcf4\uc558\uc2b5\ub2c8\ub2e4! \ucea0\ud551 \ucc98\uc74c \uc2dc\uc791\ud558\uc2dc\ub294 \ubd84\ub3c4 10\ubd84 \uc815\ub3c4\uba74 \uae08\ubc29 \uc124\uce58\ud560 \uc218 \uc788\ub294 \uc790\ub9bd\ud615 \ub3d4\ud150\ud2b8! \ud50c\ub77c\uc774 \uc124\uce58\ub3c4 \uac04\ub2e8\ud558\uace0 \uc9c1\uad00\uc801\uc778 \uc81c\ud488! \uac04\ub2e8\ud558\uc9c0\ub9cc \ucea0\ud551\uc5d0 \ud544\uc694\ud55c \ud2b9\uc7a5\uc810\ub4e4\uc740 \uc788\ub294 \uc785\ubb38\uc6a9 \ucd5c\uc801\ud654 \ud150\ud2b8\uc778\uac83 \uac19\uc544\uc694!!!\n\n\u200d\u2640\ufe0f\ud2b9\uc9d5 \ubc0f \uc7a5\uc810 / \uc5b8\ubc15\uc2f1 \ud6c4\uae30\n\u2714\uc124\uce58 \ubc0f \ucca0\uc218\uac00 \uc544\uc8fc \uc26c\uc6c0! \n\ud3f4\ub300\ub97c 4\uad70\ub370 \uadc0\ud241\uc774\uc774 \uaf42\uc544\uc8fc\uace0 \uc774\ub108\ub97c \ud3f4\ub300\uc5d0 \uac78\uc5b4\uc8fc\uba74 \uc27d\uac8c \uc790\ub9bd\ub428!\n\u2714\ubbf8\ub2c8\uba40\ucea0\ud551\uc6a9, \ucd08\ub300\uc6a9, \uc11c\ube0c\uc6a9 \ud150\ud2b8\ub85c good! \ucea0\ud551\uc744 \uc2dc\uc791\ud558\ub294 \ubd84\ub4e4\uc5d0\uac8c \ucd94\ucc9c!\n\u2714\ub354\ube14\uc6d4(\uc774\uc911) \uad6c\uc870\ub85c \uacb0\ub85c\ubc29\uc9c0! \ubca4\ud2f8\ub808\uc774\uc158 \ud658\uae30\ub85c \uc5f4\uac10\uc18c\uae30\ub2a5!\n\u2714\uc6d0\ub2e8\uc774 \ub450\uaecd\uace0 \ud2bc\ud2bc\ud574\uc11c \ubc14\ub78c \ubc0f \uc6b0\uc911\ucea0\ud551\uc5d0\ub3c4 \uc548\uc815\uc801\uc77c\uac83\uac19\uc74c! (\ub0b4\uc218\uc555 \ubc0f \uc708\ub4dc\ud14c\uc2a4\ud2b8 \uac80\uc99d)\n\u2714\ub370\uce74\ud2b8\ub860 \ud150\ud2b8\ub294 \uc720\ub7fd\uc5d0\uc11c \uc628 \ube0c\ub79c\ub4dc\ub85c! \ub3c5\ud2b9\ud558\uace0 \uce5c\ud658\uacbd\ub514\uc790\uc778\uc774 \ud2b9\uc9d5!!! \ud150\ud2b8 \ud558\ub098\ub85c \uc554\ub9c9, \uc5f4\uac10\uc18c\uae30\ub2a5, \ubc14\ub2e5\uc2b5\uae30\ucc28\ub2e8 \uae30\ub2a5\uc744 \ud558\ub294 \ud150\ud2b8!\n\u2714\uc774\ub108\ud150\ud2b8 \ubc14\ub2e5\ubd80\ubd84\uc774 \uadf8\ub77c\uc6b4\ub4dc\uc2dc\ud2b8 \uc5ed\ud560\uc744 \ud574\uc8fc\ub294 \uc7ac\uc9c8!\n\u2714\uc774\ub108\ud150\ud2b8 \uba74\uc801\uc774 210*195,  \ub192\uc774 120cm\uc815\ub3c4\ub85c 3\uba85\uc815\ub3c4 \uc0ac\uc6a9\uac00\ub2a5\ud55c \ud06c\uae30! \uc9d0\ub3c4 \ud568\uaed8 \ub123\uace0 \ub109\ub109\ud558\uac8c \uc0ac\uc6a9\ud558\ub824\uba74 2\uba85\uc774 \uc0ac\uc6a9\ud558\uae30 \uc88b\uc744\uac83 \uac19\uc544\uc694!\n\n\uc544\uc26c\uc6b4\uc810\n\u2714\ud3f4\ub300\ub97c \ucc98\uc74c \uaebc\ub0c8\uc744\ub54c \ud3f4\ub300\ubd80\ubd84\uc5d0 \uae30\uc2a4\uac00 \uc788\uc5c8\uc74c! \n\u2714\uc9c0\ud37c\uac00 \ud55c\ubc29\ud5a5\uc73c\ub85c\ub9cc \uc5f4\ub9bc! \ubc29\uc218\uc9c0\ud37c\ub294 \uc544\ub2d8! \uadf8\ub7ec\ub098 \uc774\uc911\uc9c0\ud37c\ub85c \uc548\ucabd \ubc14\uae65\ucabd \ubaa8\ub450 \uc5f4\ub9bc!\n\u2714\ud329\uc740 \uc813\uac00\ub77d\ud329\uc73c\ub85c \uc57d\ud560\uac83 \uac19\uc74c!\n\u2714\ub9e4\uc26c\ubd80\ubd84\uc774 \uc801\uc5b4\uc11c \ud55c\uc5ec\ub984\uc5d4 \ub354\uc6b8 \uc218 \uc788\uc744 \uac83 \uac19\uc74c!\n\u2714\uc785\uad6c\uac00 \ud55c\ucabd\uc5d0\ub9cc \uc788\uc74c!!\n\u2714\ud50c\ub77c\uc774 \uc6d0\ub2e8\uc5d0 \uc2a4\ucee4\ud2b8\uac00 \uc5c6\uc5b4\uc11c \ubc14\ub78c \ub3d9\ubc18\ud55c \uc6b0\uc911\ucea0\uc2dc \uc870\uc2ec\ud574\uc57c\ud560 \uac83 \uac19\uc74c!\n\n\uc2e4\uc81c \ucea0\ud551\uc2dc \n\uc0ac\uc6a9\ud574\ubcf4\uace0 \ud6c4\uae30 \ub610 \ub0a8\uae30\uaca0\uc2b5\ub2c8\ub2e4!! \n\n\ucfe0\ud321\uccb4\ud5d8\ub2e8 \uc774\ubca4\ud2b8\ub85c \uc81c\ud488\uc81c\uacf5\ubc1b\uc544 \uc0ac\uc6a9\ud574\ubcf8 \ud6c4\uae30\uc785\ub2c8\ub2e4.\n                    \n                ",
