      "\n                    \n                        \uc544\uc774\uac00 \ucea0\ud551 \ucea0\ud551 \ub178\ub798\ub97c \ubd88\ub7ec\uc11c \n\ud150\ud2b8\ub97c \ud558\ub098 \uc0ac\uc57c\ud558\ub2e4 \uace0\ubbfc\ud558\ub358 \uc911\uc5d0 \n\uccb4\ud5d8\ub2e8\uc744 \ud1b5\ud574 \uc694 \ud150\ud2b8\ub97c \uc2e0\uccad\ud558\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \n\ub450\uadfc\ub450\uadfc\n\n\ucea0\ud551\uc740 \ucd08\ubcf4\ub3c4 \uc544\ub2c8\uace0 \uc644\uc804 \ubb34\uc9c0\ub801\ubc45\uc774\uc5ec\uc11c \n\uadf8\ub0e5 \ud150\ud2b8\ub77c\ub294\uac70 \ube7c\uace4 \uc544\ub294\uac8c \ud558\ub098\ub3c4 \uc5c6\uc5c8\uc2b5\ub2c8\ub2e4. \n\uc81c\ud488\uc744 \ubc30\uc1a1\ubc1b\uace0 \uc5bc\ub978 \ud3b4\ubcf4\ub7ec\uac00\uace0 \uc2f6\uc5b4\uc11c \n\uc544\uc774\uc640 \ubc1c\uc744 \ub3d9\ub3d9 \uad74\ub800\ub294\ub370 \n\uacc4\uc18d \ube44\uac00 \uc640\uc11c \uc9d1\uc5d0\uc11c \uba3c\uc800 \ud3b4\ubcf4\uc558\uc2b5\ub2c8\ub2e4. \n\n\uc6f9\uc0c1\uc73c\ub85c \ubd24\uc744 \ub54c\ub294 3\uc778\uc6a9\uc774\ub77c\ub3c4 \uc791\uc544\ubcf4\uc600\ub294\ub370 \n\uc2e4\uc81c\ub85c \ud3b4\ubcf4\ub2c8\uae4c \uc81c\ubc95 \ud06c\ub354\ub77c\uad6c\uc694. \n\ucc9c\uc7a5\ub3c4 \ub0ae\uc544\ubcf4\uc600\ub294\ub370 \uc804\ud600\uc694. \n\uc0ac\uc6a9\ud558\ub294\ub370 \ubb38\uc81c \uc5c6\uc774 \uc544\uc8fc \ub099\ub099\ud558\ub2c8 \uc88b\uc558\uc2b5\ub2c8\ub2e4. \n\n\uce58\ub294 \ubc29\ubc95\uc5d0 \ub300\ud55c \uc124\uba85\uc11c\uac00 \ub098\uc640\uc788\uae34 \ud55c\ub370 \n\ubabb \uc54c\uc544\ubcf4\uaca0\ub354\ub77c\uad6c\uc694. \n\uadf8\ub798\uc11c \uc81c\ud488\uba85\uc744 \uac80\uc0c9\ud574\ubd24\ub354\ub2c8 \n\uc720\ud29c\ube0c\uc5d0 \uc124\uce58 \ub3d9\uc601\uc0c1\uc774 \uc798 \ub098\uc640\uc788\uc5c8\uc2b5\ub2c8\ub2e4. \n\uc544\uc774\uc640 \uaf3c\uaf3c\ud788 2\ubc88 \ub3cc\ub824\ubcf4\uace0 \ub530\ub77c\ud574\ubd24\uc2b5\ub2c8\ub2e4. \n\ub450\uadfc\ub450\uadfc\n\n\uc624, \uc544\uc8fc \uc26c\uc6cc\uc694. \n\ub545\uc5d0 \ubabb(?)\ubc15\ub294\uac78 \uc548\ud574\uc11c \uadf8\ub7f0\uc9c0 \ubab0\ub77c\ub3c4 \n\uc544\uc8fc \uc190\uc27d\uac8c \ube68\ub9ac \uce60 \uc218 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.\n5\ubd84\uc815\ub3c4 \uac78\ub9b0 \uac83 \uac19\uc544\uc694.\n\uc0c8 \ud150\ud2b8\ub77c \ub0c4\uc0c8\uac00 \uc880 \ub098\uc11c \ucc3d\ubb38 \uc5f4\uace0 \ub0c4\uc0c8 \uc880 \ube7c\uace0 \n\uc544\uc774\uc640 \uc2e4\ub0b4\ud150\ud2b8 \ub180\uc774 \uc2e0\ub098\uac8c \ud588\ub124\uc694. \n\n\uba70\uce60 \uc9c0\ub098\uace0 \ud574\uac00 \ub098\uc11c \n\uc544\uc774\uc544\ube60\uac00 \uc544\uc774\ub97c \ub370\ub9ac\uace0 \ud150\ud2b8\ub97c \uce58\ub7ec \ub2e4\ub140\uc654\uc2b5\ub2c8\ub2e4. \n\uae00\ub7a8\ud551\uc744 \ud55c \ubc88 \uac00\ubcf4\uae34 \ud588\uc9c0\ub9cc \n\ubcf4\ud1b5 \ub9ac\uc870\ud2b8\ub098 \ud638\ud154 \uc5ec\ud589\ub9cc \ub2e4\ub140\ubd24\ub358\uc9c0\ub77c \n\uc544\uc774\uac00 \uc5bc\ub9c8\ub098 \ub4e4\ub5b4\ub294\uc9c0 \uc0ac\uc9c4\uc5d0\uc11c\ub3c4 \ub290\uaef4\uc9c0\ub354\ub77c\uad6c\uc694. \n\n\uadf8\ub7f0\ub370 \ud150\ud2b8\uc5d0 \uc554\ub9c9\ucc9c?\uae4c\uc9c0 \uc50c\uc6b0\uace0 \ub098\ub2c8 \n\ub290\ubbc0 \ub354\uc6cc\uc11c \uc8fd\uc744\ubed4\ud588\ub300\uc694. \u314b\u314b\u314b\n\ub0a0\uc774 \uc81c\ubc95 \ub354\uc6e0\ub294\ub370 \uadf8\ub298\ub3c4 \uc544\ub2cc\ub370 \ud150\ud2b8\ub97c \ud3c8\uc73c\ub2c8 \u314b\u314b \n\ubc24\uc5d0 \uc790\uae30\uc5d4 \uc544\uc8fc \ub531\uc77c \uac83 \uac19\ub2e4\uace0 \ub0a8\ud3b8\uc774 \uadf8\ub7ec\ub124\uc694. \n\uc88b\uc740 \uae30\ud68c\uc5d0 \uc88b\uc740 \uc0c1\ud488\uc73c\ub85c \uc990\uac70\uc6b4 \uc2dc\uac04\uc744 \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4.\n\n \ucfe0\ud321\uccb4\ud5d8\ub2e8 \uc774\ubca4\ud2b8\ub85c \uc0c1\ud488\uc744 \ubb34\ub8cc\ub85c \uc81c\uacf5 \ubc1b\uc544 \uc791\uc131\ud55c \uad6c\ub9e4 \ud6c4\uae30\uc785\ub2c8\ub2e4.\n                    \n                ",
