      '\n                    \n                        \uba87\ub144 \uc804\ubd80\ud130 \ub0a8\ud3b8\uacfc \uc8fc\ub9d0\uc744 \uc774\uc6a9\ud574 \uc7a5\uac70\ub9ac \uc5ec\ud589\uc744 \ud558\uace4 \ud569\ub2c8\ub2e4. \ub300\uac1c \uae08\uc694\uc77c \ud1f4\uadfc \ud6c4 \n\ud55c\uc7a0 \uc790\uace0 \uc0c8\ubcbd\uc5d0 \uc77c\uc5b4\ub098 \ub5a0\ub0a0 \ub54c\ub3c4 \ub9ce\uc740\ub370\n\uc0c8\ubcbd 6\uc2dc \ubb34\ub835 \ub3c4\ucc29\ud558\uba74 \uc560\ub9e4\ud574\uc694.\n\n\uadf8\ub54c\ub294 \uc219\ubc15\uc5c5\uc18c\ub85c \ub4e4\uc5b4\uac00\uae30\uc5d0\ub3c4 \uadf8\ub807\uace0\ud574\uc11c\n\ucc28\uc5d0\uc11c \ud55c\ub450 \uc2dc\uac04 \ub208\uc744 \ubd99\uc77c \ub54c\ub3c4 \uc788\uc5b4\uc694.\n\n\uadf8\ub7f4 \ub54c\uba74 \uc791\uc740 \ud150\ud2b8 \ud558\ub098 \uac00\uc9c0\uace0 \ub2e4\ub2c8\uba70 \n\uc7a0\uae50 \ub208 \ubd99\uc774\uba74 \uc88b\uaca0\ub2e4 \uc0dd\uac01\ud55c \uc801 \uc788\uc5b4\uc694. \n\n\ub610\ud55c, \ud3c9\uc18c \ub0a8\ud3b8\uc774 \ub09a\uc2dc\ub97c \uac00\uace0 \uc2f6\uc5b4\ud558\ub294\ub370, \n\uc791\uc740 \ud150\ud2b8 \ud558\ub098 \uc0ac\uc11c \ub098\ub294 \ub0b4 \ubcfc\uc77c(\ucc45\uc744 \uc77d\uac70\ub098 \ub178\ud2b8\ubd81 \uc774\uc6a9 \uc790\ub8cc \uc815\ub9ac \ub4f1)\uc744 \ubcf4\uace0 \uadf8\ub7ec\uba74 \n"\ube68\ub9ac \uac00\uc790\uace0 \uc7ac\ucd09\ud558\uc9c0 \uc54a\uaca0\ub2e4"\uc2f6\uae30\ub3c4 \ud588\uace0\uc694.\n\n\uadf8\ub798\uc11c \uba87\ub2ec \uc804\ubd80\ud130 \ud2c8\ud2c8\uc774 \n\uc791\uc740 \ud150\ud2b8 \uc54c\uc544\ubcf4\ub358 \uc911\uc774\uc5c8\uc2b5\ub2c8\ub2e4.\n\n\u25a0\uc774\ucc98\ub7fc \uac04\ub2e8\ud55c \uc6a9\ub3c4\ub77c\uba74 \uc88b\uc744 \uac83 \uac19\uc2b5\ub2c8\ub2e4. \n\ud150\ud2b8 \uc124\uce58\ud574\ubcf8 \uc801 \uc5c6\ub294\ub370\uc694.\n\uc774\ub7f0, \uc5ec\uc790\uc778 \ub098\ub3c4 \n\uc27d\uac8c \uc124\uce58\ud560 \uc218 \uc788\uac8c \ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4.\n(\ub9c8\ub2f9\uc5d0\uc11c \uc124\uce58\ud574\ubd24\uc5b4\uc694^^\n\uc124\uba85\uc11c\uc5d0 \uc124\uce58 \uc21c\uc11c \uc798 \uc124\uba85\ub418\uc5b4 \uc788\uc74c)\n\n\ubc14\ub2e5\uba74\uacfc \ubd99\uc5b4 \uc788\ub294 \uac83\uc774 \ub0b4\ud53c. \n\uc774\uac83 \uc9c0\ubd95 \ubd80\ubd84 \ubc14\uae65 \uc815\uac00\uc6b4\ub370 \uace0\ub9ac\ub97c \n\ubf08\ub300 \uad50\ucc28\ub418\ub294 \ubd80\ubd84\uc5d0 \uac78\uc5b4\uc900 \ud6c4\n\uc678\ud53c \ub36e\uace0 4\uadc0\ud241\uc774 \uace0\ub9ac\uc5d0 \ub07c\uc6b4\ub2e4. \n\uadf8\ub7f0 \ud6c4 \ub124 \uadc0\ud241\uc774 \uace0\uc815\ud558\uba74 \ud150\ud2b8 \uc124\uce58 \ub05d.\n\n\uc774 \uc815\ub3c4\uac70\ub4e0\uc694.\n\n\u25a0\uc774\ucc98\ub7fc \uc124\uce58 \uc26c\uc6cc \ud150\ud2b8 \ucd08\ubcf4\uc790 \uc785\ubb38\uc6a9\uc73c\ub85c \uc88b\uaca0\uc2b5\ub2c8\ub2e4. \n\n\u25a04\uadc0\ud241\uc774\ub9c8\ub2e4 \ub2ec\ub824 \uc788\ub294 3\uac1c\uc758 \uace0\ub9ac\ub4e4.\n\ubc29\ucda9\ub9dd\uc774\ub098 \ud150\ud2b8\ub97c \uc5ec\ub2eb\ub294 \uc9c0\ud37c...\ub4f1 \ubd80\uc18d\ubb3c\uacfc \ubc14\ub290\uc9c8 \uc6b0\uc218\ud55c \ud3b8\uc785\ub2c8\ub2e4.\n\n\u25a0\ud150\ud2b8\uac00 \ub3cc\ub3cc \ub9d0\ub824 \ub09a\uc2ef\ub300 \uc791\uc740 \uac00\ubc29 \uac19\uc740 \uac83\uc5d0 \ub123\uc5b4\uc838 \uc654\ub294\ub370\uc694. \uc740\ubc15\uc9c0 \ub3d7\uc790\ub9ac \n\ub465\uadf8\ub807\uac8c \ub9d0\ub9b0 \uadf8\uac83\ubcf4\ub2e4 \uae38\uc774\uac00 \uc57d\uac04 \ub354 \ud070\n\uc0ac\uc774\uc988\uc785\ub2c8\ub2e4.\n\n\uac8c\ub2e4\uac00 3\ud0ac\ub85c \ubb34\uac8c. \n\ub204\uad6c\ub098 \uc27d\uac8c \ub4e4 \uc218 \uc788\uaca0\uc5b4\uc694. \n\uadf8\ub7f0\ub9cc\ud07c \ubd80\ub2f4\uc5c6\uc774 \uc4f8 \uc218 \uc788\uc744 \uac70\uad6c\uc694. \n\n\u25a03\uc778\uc6a9\uc774\uba74 \uc131\uc778 2\uc778\uc774 \ub9de\uaca0\ub294\ub370 \n\uc194\uc9c1\ud788 \ud150\ud2b8 \uc0ac\ubcf8 \uc0ac\ub78c\ub4e4\uc740 \n\uc774\ub807\uac8c \uacc4\uc0b0\ud574\uc11c \uad6c\uc785\ud558\uc796\uc544\uc694.\n\n\uadf8\ub7f0\ub370 \uc131\uc778 3\uba85 \ub204\uc6b8 \uc218 \uc788\uaca0\ub294\ub370\uc694.\n\uac00\ub054 1\ubc15 2\uc77c\uc5d0\uc11c \n\uc57c\uc678 \ucde8\uce68 \ub2f9\ucca8\ub41c 3\uc778\uc774 \ud55c \ud150\ud2b8\uc5d0\uc11c \uc790\uc796\uc544\uc694.\n\uadf8\ubcf4\ub2e4 \uc870\uae08 \ub099\ub099\ud558\uac8c \ub290\uaef4\uc84c\uc5b4\uc694.\n\n\u25a0\ud150\ud2b8 \uc774\uc0c1\uc774 \uc788\ub098? \uc5c6\ub098? \ud655\uc778\ub3c4 \ud558\uace0\n\uc5b4\ub5bb\uac8c \uce58\ub294 \uac83\uc778\uac00 \uc0ac\uc804\uc5d0 \uc54c\uc544\uc57c\ud560 \uac83 \uac19\uc544\n\uc77c\uc694\uc77c\uc778 \uc5b4\uc81c \ud55c\ub0ae\uc5d0 \ub9c8\ub2f9\uc5d0 \uc124\uce58\ud574\ubd24\ub294\ub370\uc694.\n\n\ub9c8\ub2f9 \uc804\uccb4 \ubcf4\ub3c4\ube14\ub7ed\uc774 \uae54\ub824 \uc788\uc5b4\uc11c \n\ub545\uc18d\uc73c\ub85c \ubc15\uc544 \uace0\uc815\ud558\ub294 \uadf8\uac70 \ud558\uc9c0 \ubabb\ud588\uac70\ub4e0\uc694. \uadf8\ub7f0\ub370\ub3c4 \uc9f1\uc9f1\ud558\uac8c \uace0\uc815\ub418\ub354\ub77c\uace0\uc694,\n\ubc14\ub78c\ub3c4 \uc880 \uc0b4\ub791\uc0b4\ub791 \ubd88\uc5c8\ub294\ub370\ub3c4.\n\n\ub0a8\ud3b8\uc774 \uadf8\ub7ec\ub358\ub370\uc694.\n"1\ubc15 \uc790\uba74 \ubaa8\ub97c\uae4c. \uadf8\ub0e5 \uba87\uc2dc\uac04 \uc26c\uac70\ub098\n\ub0ae\uc5d0 \ub0ae\uc7a0 \uc790\ub294 \uc6a9\ub3c4\ub77c\uba74 \uadf8\uac70\uae4c\uc9c0 \ubc15\uc9c0 \uc54a\uace0 \uac00\ubccd\uac8c \uc4f0\ub294 \uac83\uc73c\ub85c\ub3c4 \uc88b\uc744 \uac83 \uac19\ub2e4"\uace0.\n\n\u25a0\uc880 \uc544\uc26c\uc6b4 \uac83\uc740 \uc554\ub9c9\uc774 \ub5a8\uc5b4\uc9c8\uc9c0\ub3c4 \ubaa8\ub978\ub2e4\ub294, \n\uadf8\ub798\uc11c \ud55c\uc5ec\ub984\uc5d4 \uc870\uae08 \ub354\uc6b8\uc9c0\ub3c4 \ubaa8\ub974\uaca0\ub2e4\ub294 \uac83\uc785\ub2c8\ub2e4.\n\n\uc77c\uc694\uc77c \uc5b4\uc81c(12\uc77c), \ud55c\ub0ae\uc5d4 \uc880 \ub354\uc6e0\ub294\ub370\uc694.\n\uc124\uce58 \ud6c4 30\ubd84 \uc815\ub3c4 \ud150\ud2b8\uc548\uc5d0\uc11c \n\ucc45\uc744 \uc77d\uc5c8\ub294\ub370 \ub9c9 \ub365\uc9c0\ub294 \uc54a\uc558\uc73c\ub098 \uc544\uc8fc \uc870\uae08...\n\n\n_______________________________________\n\n\uc774 \ud150\ud2b8 \uac00\uaca9\uc774 6\ub9cc\uc6d0\ub300\uc785\ub2c8\ub2e4.\n\ucc3e\uc544\ubcf4\ub2c8 2\ub9cc\uc6d0\ub300\ub3c4 \ubcf4\uc774\uae34 \ud558\uc9c0\ub9cc\n\uc0ac\uc2e4 \uac12\ub9cc \ubcf4\uba74 \uc800\ub834\ud55c \ud3b8\uc5d0 \uc18d\ud558\ub294 \ud150\ud2b8\uc8e0.\n\n\uc0ac\uc2e4 \uc774 \ud150\ud2b8 \uc811\ud558\uae30 \uc804\uae4c\uc9c0 \n15\ub9cc\uc6d0\ub300 \uc54c\uc544\ubd24\uc2b5\ub2c8\ub2e4. \n\n30\uc5ec\ub144\uc804 \uc790\uce7c \ud150\ud2b8 \ud310\ub9e4\ud574\ubcf8\uc801 \uc788\ub294 \ub0a8\ud3b8\uc774 \n\uadf8 \uc815\ub3c4\ub294 \ub418\uc5b4\uc57c \uadf8\ub798\ub3c4 \uc880 \uc4f8 \uc218 \uc788\ub2e4\uace0 \n\ub9d0\ud588\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4. \n\n\ucfe0\ud321 \uccb4\ud5d8\ub2e8\uc5d0 \uc120\uc815 \ucd08\ub300, \n\uc774 \uc0c1\ud488\uc744 \uccb4\ud5d8\ud574\ubcf4\uc790 \uc2e0\uccad\ud588\uc2b5\ub2c8\ub2e4. \n\n\uadf8\ub7ec\ub098 \ub9c9\uc0c1 \ub0a8\ud3b8\uc758 \ub9d0\ub3c4 \uc788\uace0\ud574\uc11c\n\ub108\ubb34 \uc2fc\ud2f0 \ub098\ub294 \uc81c\ud488 \uc544\ub2d0\uae4c? \n\uc2a4\uc2a4\ub85c \uc8fc\ub205\ub4e4\uc5c8\ub294\ub370 \ub0a8\ud3b8\uc774 \uadf8\ub7ec\ub124\uc694.\n\n"\uc774 \uc815\ub3c4 \uac00\uaca9\uc5d0 \uc774 \uc815\ub3c4\uba74 \uc544\uc8fc \n\uad1c\ucc2e\uc740 \ud3b8\uc774\uc57c!"\n\n\ucd94\uc11d \uc9c0\ub098 \uc880 \uc5ec\uc720 \uc0dd\uae30\uba74 \n\ud150\ud2b8 \ub9ac\uc5bc\ud558\uac8c \uccb4\ud5d8\ud558\ub7ec \ub5a0\ub098\ubd10\uc57c\uaca0\uc5b4\uc694.\n\n \ucfe0\ud321\uccb4\ud5d8\ub2e8 \uc774\ubca4\ud2b8\ub85c \uc0c1\ud488\uc744 \ubb34\ub8cc\ub85c \uc81c\uacf5 \ubc1b\uc544 \uc791\uc131\ud55c \uad6c\ub9e4 \ud6c4\uae30\uc785\ub2c8\ub2e4.\n                    \n                ',
