      "\n                    \n                        10\ub9cc\uc6d0\uc774 \uc548\ub418\ub294 \uac00\uaca9\uc778\ub370 \n\ud004\ub9ac\ud2f0\uac00 \ub9e4\uc6b0 \uc88b\uc740 \ud3b8\uc784 \n\ucea0\ud551\uc7a5\ube44\ub97c \uacbd\ub7c9 or \ubc31\ud328\ud0b9\uc6a9\uc73c\ub85c \ubc14\uafb8\ub294 \uc911\uc778\ub370 \n\uc774 \ud150\ud2b8\ub294 \ubc31\ud328\ud0b9\uae4c\uc9c0\ub294 \uc880 \ubb34\uac81\uc9c0\ub9cc \n\ubbf8\ub2c8\uba40 \uacbd\ub7c9 \ucea0\ud551\uc73c\ub85c\ub294 \uc544\uc8fc \uc88b\uc544\uc694\n\uc77c\ub2e8 \ubd80\ud53c\uac00 \uc791\uac8c \ud328\ud0b9\uc774 \ub418\uc5b4\uc11c \uc88b\uace0 \n\uac00\ubc29\uc774 \ub2e4 \uc77c\uccb4\ud615\uc73c\ub85c \ub418\uc5b4\uc788\uc5b4\uc11c \n\ud329 \ud30c\uc6b0\uce58\ub098 \uace0\uc815 \uc2a4\ud2b8\ub7a9 \uc783\uc5b4\ubc84\ub9b4 \uc77c \uc5c6\uc5b4\uc694 \n\uadf8\ub9ac\uace0 \uac00\uc7a5 \ub180\ub780\uac83\uc774 \ud06c\uae30 \uc785\ub2c8\ub2e4\n\ud06c\uae30\uac00 \ucee4\uc694 \ubcf4\ud1b5 3\uc778\uc774\uba74 \ub450\uba85 \ucee4\ubc84\ub418\uae30 \ub9c8\ub828\uc778\ub370\n\uc544\uac74 \ub124\uba85\uae4c\uc9c0 \uac00\ub2a5\ud560\uac83 \uac19\uc544\uc694 \n\ud06c\uae30\uac00 \ub109\ub109\ud558\ub2c8\uae4c \uc88b\ub124\uc694. \uc218\ub0a9\uc740 \uc791\uc740\ub370 \ud06c\uae30\uac00 \ud06c\ub2c8 \ub354\uc6b1 \uad7f\n\ucc38\uc9c0\ubabb\ud558\uace0 \uc9d1\uc548\uc5d0\uc11c \uccd0\ubd24\ub294\ub370\n\ud53c\uce6d\uc774 \uc544\uc8fc \uc26c\uc6cc\uc694 \n\ud3f4\ub300 \ub450\uac1c\ub9cc \ub124 \uadc0\ud241\uc774\uc5d0 \ud06c\ub85c\uc2a4\ub85c \uccb4\uacb0\ud558\uace0\n\ubc84\ud074 \ucc29\ucc29 \ub07c\uc6b0\uba74 \ub05d \n\ud50c\ub77c\uc774\ub294 \uc785\uad6c \ucc3e\uc544 \uc4b8\uc6b0\uace0 \n\ub124 \uadc0\ud241\uc774 \uace0\ub9ac \uac78\uc5b4\uc8fc\uba74 \ub05d\n\ucd08\ub4f1 \uc6b8 \ub538\uc774 \ucce4\uc5b4\uc694 \u314e\u314e \n\uc774\ub108\ud150\ud2b8\ub294 \uc587\uace0 \uac00\ubcbc\uc6b4 \uc7ac\uc9c8\uc774\uace0 \n\ud50c\ub77c\uc774\uac00 \ub3c4\ud1b0\ud558\uace0 \ube44\uce58\uc9c0 \uc54a\ub294 \ud1a1\ud1a1\ud55c \uc7ac\uc9c8\n\uadf8\ub798\uc11c \uac00\ubcbc\uc6b4\uac00 \ubd05\ub2c8\ub2e4 \n\ubca4\ud2f8\ub3c4 \uc57c\ubb34\uc9c0\uac8c \uc0c8\uc6cc\uc9c0\uace0  \n\uc800\ub834\ud558\uc9c0\ub9cc \uae30\ubcf8\uae30 \ud0c4\ud0c4\ud55c \ub140\uc11d\uc785\ub2c8\ub2e4 \n\uc6b8\uc9d1 \uc5ec\uc12f\ubc88\uc9f8 \ud150\ud2b8\uc778\ub370 \uc544\uc8fc \ub9d8\uc5d0 \ub4e4\uc5b4\uc694\n\ube68\ub791 \uc774\ub140\uc11d \ub4e4\ub3c4  \ub098\uac00\uace0 \uc2f6\ub124\uc694 \u314e \n\ucea0\ud551 \uc785\ubb38\uc6a9\uc73c\ub85c\ub294 \ub354\ud560\ub098\uc704 \uc5c6\ub294 \uc81c\ud488\uc778\uac83 \uac19\uc544\uc694\n\uac00\uaca9\ub300 10\ub9cc\uc6d0 \uc548\ub418\uba74\uc11c \uc774\uc815\ub3c4 \ud004\uc5d0 \ub354\ube14 \uc2a4\ud0a8\uc774\ub77c\n\uac10\ud0c4\uc774 \uc808\ub85c \ub098\uc635\ub2c8\ub2e4 \n\uc785\ubb38\uc6a9\uc73c\ub85c \ud639\uc740 \ubbf8\ub2c8\uba40\uc6a9\uc73c\ub85c \ucc10\ucd94 \uac15\ucd94 \n\uc9c4\uc2ec \uc6b0\ub7ec\ub098\ub294 \ud6c4\uae30\uc785\ub2c8\ub2e4 \n\ub370\uce74\ud2b8\ub860 \uac00\uaca9 \ud569\ub9ac\uc801\uc774\uace0 \ud488\uc9c8 \uc88b\ub2e4\uace0 \uc785\uc18c\ubb38 \uc790\uc790\ud55c\ub370\n\ubab8\uc18c \ub290\uaef4\ubcf4\ub2c8 \uc9c4\uc9dc\ub124\uc694.  \n\uc644\uc804 \uac15\ucd94 \ud569\ub2c8\ub2e4.\n\n \ucfe0\ud321\uccb4\ud5d8\ub2e8 \uc774\ubca4\ud2b8\ub85c \uc0c1\ud488\uc744 \ubb34\ub8cc\ub85c \uc81c\uacf5 \ubc1b\uc544 \uc791\uc131\ud55c \uad6c\ub9e4 \ud6c4\uae30\uc785\ub2c8\ub2e4.\n                    \n                ",
