      "\n                    \n                        \uc124\uce58 \uc0c1\uc758 \ubb38\uc81c\uc810\uc740 \uc804\ud600 \uc5c6\uad6c\uc694.\n\uc8fc\uc758\ub97c \uae30\ud558\uc5ec \ucc28\uadfc\ud788 \ud150\ud2b8\ub97c \ud3b4\uace0 \uc811\uc73c\uc2dc\uba74\n\uc5ec\uc131\ubd84\ub4e4\ub3c4 \ud3b8\uc548\ud558\uac8c \uc124\uce58\uac00 \uac00\ub2a5\ud558\ub2e4\uace0 \ubd05\ub2c8\ub2e4.\n\n\ud150\ud2b8\uac00 3\uc808\ub85c \ub418\uc5b4 \uc788\ub294\ub370\n\uaf2d\ub300\uae30 1\uc808\uacfc \uc911\uac04 2\uc808\uc740 \uc790\ub3d9\uc73c\ub85c \ud3d0\uc9c0\uace0 \uc811\ud788\ub098\n3\uc808 \ub05d\ubd80\ubd84\uc740 \ud3bc \ub54c\ub294 \uc790\ub3d9\uc73c\ub85c \ud3bc\uc218 \uc788\uc73c\ub098\n\uc811\uc744 \ub54c\uc5d0\ub294 \uc190\uc758 \uc218\uace0\uc2a4\ub7ec\uc6c0\uc774 \ub2e4\uc18c \uc788\uc74c.\n\uc0ac\uc9c4\uc5d0\uc11c \ubcf4\ub294 \ubc14\uc640 \uac19\uc774 \uc870\uae08 \uc7a1\uc544 \ub2f9\uaca8\uc57c \uc811\uc744 \uc218 \uc788\ub124\uc694.\n\n\ubd09\uc7ac \ub4f1 \ub2e4\ub978 \ubb38\uc81c\uc810\uc740 \uc5c6\ub294 \ub4ef \ud569\ub2c8\ub2e4.\n\n\ub2e4\ub9cc, \uc124\uce58 \ud6c4 \ucd9c\uc785\uad6c 2\uac1c\uc18c \uc678 \ucc3d\uc774 \uc5c6\ub2e4\ub294 \uac83\uc774\n\uc870\uae08 \uc544\uc26c\uc6b4 \uc810\uc774\ub77c\uace0 \uc0dd\uac01\uc744 \ud588\ub124\uc694.\n\n\ucc3d\ubb38 \ud55c \ub450\uac1c\ucbe4\uc740 \uc788\uc74c \uc88b\uaca0\ub2e4\uace0 \uc0dd\uac01\uc744 \ud588\ub124\uc694.\n\n\uc2e4\ub0b4\uc5d0 \ub4f1 \uac78\uc774\ub3c4 \uc788\uc5b4 \uc88b\ucfe0\uc694\n\uc2e4\ub0b4\ub3c4 \uc0dd\uac01\ubcf4\ub2e4 \ub113\uace0\n\uc5d0\uc5b4\ub9e4\ud2b8 180 x 60 x 5 cm \ub450\uac1c\ub97c \uae54\uc544\ub3c4\n\uae38\uc774\ub294 \ub531\uc774\uad6c\uc694, \uc606\uc5d0\ub294 \uc5ec\uc720\uac00 \uc788\uc5c8\ub124\uc694.\n\n\ucc3d\ubb38\uc774 \uc5c6\ub294 \uc810\uacfc, \ub05d \uc808\ubd80\ubd84\uc744 \uc811\uc744 \ub54c \uc190\uc758 \uc218\uace0\uc2a4\ub7ec\uc6c0\uc774 \uc788\uc5b4\n\ubcc4 \ub2e4\uc12f\uac1c\ub294 \uc880 \uadf8\ub7ec\ud558\ub124\uc694.\n                    \n                ",
