      "\n                    \n                        \uc800\uc758 \ub2e4\uc12f\ubc88\uc9f8 \ud150\ud2b8 \uad6c\uc785 \uc785\ub2c8\ub2e4. \uac00\uaca9\ub300\ube44 \ucd5c\uace0\uc785\ub2c8\ub2e4. \uc54c\ub9ac\ubbf8\ub284\ud3f4\ub300 \ubcf4\ub2e8 \ubb34\uac81\uc9c0\ub9cc \ud654\uc774\ubc14\uc81c\uc9c8 \ubcf4\ub2e4\ub294 \ud6e8\uc52c\uac00\ubccd\uace0 \ud3b8\ud569\ub2c8\ub2e4. \ubb3c\ub860 \uac00\uaca9\uc774 \uc2f8\ub2e4\ubcf4\ub2c8 \ub9c8\uac10\uc740 \uc88b\uc9c0 \uc54a\uc9c0\ub9cc \uc5f4\ubc88\ub9cc \uc0ac\uc6a9\ud558\uace0 \ubc84\ub824\ub3c4 \ud55c\ubc88 \uc0ac\uc6a9\uc5d0 5\ucc9c\uc6d0 \uc785\ub2c8\ub2e4. \uc124\uce58\uc758 \ud3b8\uc548\ud568\uc774 \ubaa8\ub4e0\uac78 \uce74\ubc14 \ud569\ub2c8\ub2e4. \uc2ed\ucd08\uba74 \ud3c5\ub2c8\ub2e4. \uaf2d\uc9c0 \ub4e4\uc5b4\uc11c \ud754\ub4e4\uba74 \ub2e4\ub9ac\ud3b4\uc9c0\uace0 \ubc14\ub85c \uafb9\ub290\ub974\uba74 \uc644\uc131. \n\n\ub2e4\ub978 \ube44\uc2b7\ud55c \ud150\ud2b8\uc5d0\ub294 \uc5c6\ub294 \ud6c4\ub77c\uc774\ub3c4 \uc544\uc8fc \uc720\uc6a9\ud569\ub2c8\ub2e4. \uc774 \ud6c4\ub77c\uc774\uac00 \uad6c\ub9e4\uc758 \uacb0\uc815\uc801\uc778 \uc694\uc778\uc774 \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \ucea0\ud551\ucd08\ubcf4\ubd84\ub4e4\uc774 \uc800\uac00\ud615\uc744 \ub9ce\uc774 \uad6c\ub9e4\ud558\uc2dc\ub294\ub370, \ud50c\ub77c\uc774\uac00\ud3ec\ud568\ub418\uc9c0 \uc54a\uc740 \ud150\ud2b8\uac00 \ub9ce\uc2b5\ub2c8\ub2e4. \uc774 \ud50c\ub77c\uc774\uac00 \uc788\uace0 \uc5c6\uace0\ucc28\uc774\uac00 \uac00\uc744, \uaca8\uc6b8\uc5d0 1\ubc15\uc744 \ud560\uc218 \uc788\ub0d0 \uc5c6\ub290\ub0d0 \ucc28\uc774 \uc785\ub2c8\ub2e4. \uc77c\uad50\ucc28\uac00 \ud070 \uac00\uc744\uc5d0\ub294 \ub0b4\ubd80\uc5d0 \uacb0\ub85c\ud604\uc0c1\uc73c\ub85c \uc774\uc2ac\uc774 \ub9fa\ud788\ub294\uac8c \uac70\uc758 \ud64d\uc218\ucc98\ub7fc \uc3df\uc544\uc9d1\ub2c8\ub2e4. \uc774\uac78 \ud50c\ub77c\uc774\uac00 \ub9c9\uc544\uc90d\ub2c8\ub2e4. \ubb34\uc870\uac74 \ud50c\ub77c\uc774\uac00 \ud3ec\ud568\ub41c \uc774\ud150\ud2b8\uc0ac\uc138\uc694. \ub0ae\uc5d0 \uac15\uac00\uc5d0\uc11c \uc544\uc774\ub4e4\uc774\ub791 \uc7a0\uae50 \ub180\ub2e4 \uac00\uc2dc\ub294 \ubd84\ub4e4\uc740 \ud50c\ub77c\uc774\uac00 \ud314\uc694 \uc5c6\uaca0\uc9c0\ub9cc. \uc870\uae08\uc774\ub77c\ub3c4 \ud150\ud2b8\uc758 \uc0ac\uc6a9\uc5d0 \ud655\uc7a5\uc744 \uc6d0\ud558\uc2dc\uba74 \ud50c\ub77c\uc774\uac00 \ud3ec\ud568\ub41c\uac70 \uc0ac\uc138\uc694. \uc808\ub300 \uc774\ud150\ud2b8\ub97c \uc2f8\ub2e4\uace0 \ud5c8\uc811\ud558\uac8c \ubcf4\uc9c0\ub9c8\uc138\uc694.\n\n\uc624\uc9c0 \ucea0\ud551 \uc624\ub144 \ub118\uac8c \ud588\uc2b5\ub2c8\ub2e4. \uc194\ucea0\uc5d0 \ucd5c\uace0\uc785\ub2c8\ub2e4. \uc194\ucea0\uc740 \ubb34\uc870\uac74 \ud3b8\ud574\uc57c\ud569\ub2c8\ub2e4. \uc0dd\uac01\ubcf4\ub2e4 \uac00\ubccd\uc2b5\ub2c8\ub2e4. \ucd5c\uc8003\ub3c4 \ubc24\uc5d0\ub3c4 \ucea0\ud551 \uc798\ud588\uc2b5\ub2c8\ub2e4. \uc880\ub354 \ucd94\uc6cc\uc9c0\ub294 \uaca8\uc6b8\uc5d0\ub3c4 \uc774\ud150\ud2b8\ub85c \ub3c4\uc804\ud560\uc0dd\uac01\uc785\ub2c8\ub2e4.\n                    \n                ",
